import React from 'react';
import PropTypes from 'prop-types';
import styles from './Navbar.module.css';
import { Link } from 'react-router';

function Navbar() {
  return (
    <div>
      <a to="/">Home</a>
      <a to="/about">About Us</a>
      <a to="/shop">Shop Now</a>
    </div>
  );
};

export default Navbar;
